import "bootstrap/dist/css/bootstrap.min.css";
import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Auth from "./Auth/Auth";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/Auth/auth" element={<Auth />} />
      </Routes>
    </BrowserRouter>
  )
}

export default App
